import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./Home";
import WeekView from "./WeekView";

const App = () => {
  return (
    <Router basename="/HabitMate">
      <Routes>
        <Route path="/" element={<Home />} />

      </Routes>
    </Router>
  );
};

export default App;
